/**************** Callback ****************
Example:

// Definition
#define PEBBLE_ActionBarLayerSetClickConfigProviderTemplate(callback, action_bar) \
  action_bar_layer_set_click_config_provider(action_bar, callback)
  
#define m_action_bar_layer_set_click_config_provider(action_bar, callback_params, body) \
	DSL_CALLBACK_OUTPUT(DSL_UNIQUE_NAME(ANY_UNIQUE_NAME), void, callback_params, body, PEBBLE_ActionBarLayerSetClickConfigProviderTemplate, (action_bar))

// Invocation
m_action_bar_layer_set_click_config_provider(abl, (void *context), {
  // do your stuff here
});
  
// Output
void ANY_UNIQUE_NAME__FUNCTION__14 (void *context) {
  // do your stuff here
}
action_bar_layer_set_click_config_provider(abl, ANY_UNIQUE_NAME__FUNCTION__14);

NOTE: This is fully compatible with init/with keyword
********************************************/
#define DSL_CALLBACK_DECLARE_NESTED_FUNCTION(name, type, params, body) \
  type name params body

#define DSL_CALLBACK_OUTPUT(name, type, params, body, template, templateparams) \
  DSL_CALLBACK_DECLARE_NESTED_FUNCTION(name, type, params, body) \
  template(name, DSL_TUPLE_UNFOLD(templateparams))

/******************* With *******************
********************************************/
#define DSL_REF_METHOD_CALL(ref, method, ...) method(ref, __VA_ARGS__);

#define DSL_WITH_GENERATE0(ref, type, func, params) \
  DSL_WITH_GENERATE1(ref, type, func, params)

#define DSL_WITH_GENERATE1(ref, type, func, params) \
  DSL_WITH_GENERATE2(ref, DSL_TYPEPREFIX_##type, func, DSL_TUPLE_UNFOLD(params))

#define DSL_WITH_GENERATE2(ref, prefix, method, ...) \
  DSL_WITH_GENERATE3(ref, prefix, method, __VA_ARGS__)
  
#define DSL_WITH_GENERATE3(ref, prefix, method, ...) \
  DSL_REF_METHOD_CALL(ref, prefix##method, __VA_ARGS__)
  
#define DSL_WITH_GENERATE(reftype, func, params) \
  DSL_WITH_GENERATE0(DSL_TUPLE_ELM(0, reftype), DSL_TUPLE_ELM(1, reftype), func, params)

#define DSL_WITH_FOREACH0(action, context, arg1, arg2, arg3, ...) action(context, arg1, arg2) DSL_FOREACH_NEXT (arg3, DSL_WITH_FOREACH1) (action, context, arg3, __VA_ARGS__)
#define DSL_WITH_FOREACH1(action, context, arg1, arg2, arg3, ...) action(context, arg1, arg2) DSL_FOREACH_NEXT (arg3, DSL_WITH_FOREACH0) (action, context, arg3, __VA_ARGS__)
#define DSL_WITH_FOREACH(action, context, ...) DSL_REPEAT (DSL_WITH_FOREACH1 (action, context, __VA_ARGS__, (), 0))
  
#define DSL_WITH_SEQ_GENERATE(seq) \
  DSL_WITH_FOREACH(\
    DSL_WITH_GENERATE, \
    (DSL_SEQ_ELM(0, seq), DSL_SEQ_ELM(1, seq)), \
    DSL_TUPLE_UNFOLD(DSL_SEQ_ELM(2, seq)))
	
#define with(ref, type, ...) \
  DSL_WITH_SEQ_GENERATE((ref)(type)((__VA_ARGS__)))

/******************* Init *******************
Example:

// Definition
#define DSL_INIT_ActionBarLayer(ref, params) \
  ref = action_bar_layer_create params 
  
#define DSL_TYPEPREFIX_ActionBarLayer action_bar_layer_
  
// Invocation
ActionBarLayer *layer;
  
init(ActionBarLayer, layer, (), 
  set_icon, (button_id, NULL),
  add_to_window, (window)
  )
  
// Output
ActionBarLayer *layer;

layer = action_bar_layer_create ();
action_bar_layer_set_icon(layer, button_id, NULL);
action_bar_layer_add_to_window(layer, window);
********************************************/
#define init(type, ref, init_params, ...) \
  DSL_INIT_##type(ref, init_params); \
  DSL_WITH_SEQ_GENERATE((ref)(type)((__VA_ARGS__)))

